import './App.css';
import React, { } from 'react';

function Rainbow({text, refLink, type, width}) {
  let divClass = "isolate " + type + "s"
  let aClassRed = type + " rainbow red"
  let aClassGreen = type + " rainbow green"
  let aClassBlue = type + " rainbow blue"

  return(
    <div className={divClass} style={{width: width}}>
      <a href={refLink} className={type + " rainbow blue"}>
        {text}
      </a>

      <a href={refLink} className={type + " rainbow green"}>
        {text}
      </a>

      <a href={refLink} className={type + " rainbow red"}>
        {text}
      </a>
    </div>
  );
}

function Title() {
  return (
    <div className="center">
    <Rainbow
        type={"title"}
        refLink = {"index.html"}
        text = {"JackSavini.com"}
      />
    </div>
  );
}

function Taskbar() {
  return (
    <div style={{ width: "80%", marginLeft: "10%" }}>
      <hr style = {{width: "100%"}}></hr>
      <div className="center navBar">
        <Rainbow
          type={"link"}
          refLink = {"aboutMe.html"}
          text = {"About Me"}
          width = {"182px"}
        />

        <Rainbow
          type={"link"}
          refLink = {"blog.html"}
          text = {"Blog"}
          width = {"85px"}
        />

        <Rainbow
          type={"link"}
          refLink = {"arcade.html"}
          text = {"Arcade"}
          width = {"130px"}
        />

        <Rainbow
          type={"link"}
          refLink = {"career.html"}
          text = {"Career"}
          width = {"125px"}
        />
      </div>
      <hr style = {{width: "100%"}}></hr>
    </div>
  );
}

function App() {
  return (
    <div>
      <Title/>
      <Taskbar/>
    </div>
  );
}

export default App;
